import './button-component.css';
import { useState } from 'react';

const [ ticValue, setTicValue ] = useState();

const selectedValue = () => {
	const changeEvent = event.target.value;
};

const changeValue = (e) => {
	e.preventDefault();
	const changeValue = e.target;
};

const ButtonComponent = () => {
	return (
		<button className="btn-frame" onClick={changeValue}>
			{selectedValue}
		</button>
	);
};

export default ButtonComponent;
